async function createWidget() {
  /* create the widget to display on the home screen */

  // attempt a fetch from the PokéAPI
  try {
    // get the current number of Pokémon from the API
    var req = new Request("https://pokeapi.co/api/v2/pokemon-species?");
    req.timeoutInterval = 5; // set a short timeout
    var numPokeApi = await req.loadJSON();

  } catch (error) {
    // the fetch failed, so return false
    return false;

  }

  // continue with the rest of the function...

  // get the maximum number of Pokémon currently in the API
  var maxDexNumber = numPokeApi["count"];

  // get a random number between 1 and maxDexNumber
  var PKMNnumber = Math.floor(Math.random() * maxDexNumber) + 1;

  // get the different varieties of the Pokémon species
  var speciesUrl = "https://pokeapi.co/api/v2/pokemon-species/" + PKMNnumber;
  var speciesApi = await new Request(speciesUrl).loadJSON();
  var varieties = speciesApi["varieties"];
  var randomIndex = Math.floor(Math.random() * varieties.length);

  // get the art and form for the Pokémon
  var pokemonApi = await new Request(varieties[randomIndex]["pokemon"]["url"]).loadJSON();
  var artUrl = pokemonApi["sprites"]["other"]["official-artwork"]["front_default"];
  var formUrl = pokemonApi["forms"][0]["url"];
  var formApi = await new Request(formUrl).loadJSON();
  var formNamesList = formApi["names"];

  // get the name of the Pokémon
  if (formNamesList.length == 0) {
    var formNamesList = speciesApi["names"];
  }
  var name = formNamesList.find(name => name.language.name == "en")["name"];


  // determine image size based on widget size
  var widgetSize = config.widgetFamily;
  if (widgetSize === "large") {
    imgHeight = 230;
    imgWidth = 230;
    var bgUrl = "https://raw.githubusercontent.com/Oshanotter/Whos-That-Pokemon-Scriptable-Widget/refs/heads/main/images/bg_guess.png";
    var topPadding = 60;
    var rightPadding = 0;

  } else if (widgetSize === "small") {
    imgHeight = 100;
    imgWidth = 100;
    var bgUrl = "https://raw.githubusercontent.com/Oshanotter/Whos-That-Pokemon-Scriptable-Widget/refs/heads/main/images/bg_guess.png";
    var topPadding = 50;
    var rightPadding = 0;

  } else if (widgetSize === "medium") {
    imgHeight = 130;
    imgWidth = 130;
    var bgUrl = "https://raw.githubusercontent.com/Oshanotter/Whos-That-Pokemon-Scriptable-Widget/refs/heads/main/images/bg_medium.png";
    var topPadding = 20;
    var rightPadding = 170;

  }

  // load the Pokémon image and the bg image
  const img = await new Request(artUrl).loadImage()
  const bgImage = await new Request(bgUrl).loadImage()

  // start creating the actual widget
  var widget = new ListWidget();
  widget.backgroundImage = bgImage;
  widget.setPadding(topPadding, 0, 0, rightPadding);

  // create the silhouette image of the Pokémon
  var image = widget.addImage(img);
  image.centerAlignImage();
  image.imageSize = new Size(imgHeight, imgWidth);
  image.applyFillingContentMode();
  image.tintColor = new Color("#000000");

  // create the url that will execute when tapping on the widget
  var scriptName = Script.name();
  widget.url = "scriptable:///run?scriptName=" + encodeURI(scriptName) + "&name=" + encodeURI(name) + "&artUrl=" + encodeURI(artUrl);

  // set the widget
  Script.setWidget(widget);
  Script.complete();

}



async function revealAnswerWidget(offline) {
  /* display the widget in the app that shows who the Pokémon is */

  // create new widget to show in app
  var widget = new ListWidget();

  // if the user is offline
  if (offline) {
    // set the Pokémon name to Missingno and get its image
    var pkmnName = "Missingno?";
    var img = getMissingnoImage();

    // create a glitchy background for Missingno
    var gradient = createGlitchyGradient();
    widget.backgroundGradient = gradient;

    // set the title text
    var titleText = "Huh... Wha?";


  } else {
    // get the Pokémon name and artUrl from the arguments passed to the script

    var pkmnName = args.queryParameters.name;
    var artUrl = args.queryParameters.artUrl;

    // load the image
    var img = await new Request(artUrl).loadImage();

    // get background image
    var bgUrl = "https://raw.githubusercontent.com/Oshanotter/Whos-That-Pokemon-Scriptable-Widget/refs/heads/main/images/bg_reveal.png"
    var bgImage = await new Request(bgUrl).loadImage();
    widget.backgroundImage = bgImage;

    // set the title text
    var titleText = "It's...";

  }


  // header Stack for the "It's..." text
  var header = widget.addStack();
  header.addSpacer(); // left spacer beside "It's..." to help center it

  // add header text
  var title = header.addText(titleText);
  title.font = Font.boldSystemFont(20);
  title.textColor = Color.black();
  title.centerAlignText();
  header.addSpacer(); // right spacer beside "It's..." to help center it

  // nameStackContainer to hold the nameStack which holds the Pokémon name
  var nameStackContainer = widget.addStack();
  nameStackContainer.layoutVertically();
  nameStackContainer.size = new Size(0, 80);
  nameStackContainer.centerAlignContent();

  // nameStack that hold the Pokémon name
  var nameStack = nameStackContainer.addStack();
  nameStack.layoutHorizontally();
  nameStack.addSpacer(); // left spacer for centering the name horizontally

  // add text to the nameStack
  var name = nameStack.addText(pkmnName);
  nameStack.addSpacer(); // right spacer for centering the name horizontally

  // adjust the font size of the name text based on its length
  if (pkmnName.length >= 14) {
    name.font = Font.boldSystemFont(30);

  } else {
    name.font = Font.boldSystemFont(40);

  }
  name.textColor = Color.black();
  name.centerAlignText(); // center text horizontally within its stack

  // body stack for the image
  var body = widget.addStack();
  body.addSpacer();
  var image = body.addImage(img);
  image.imageSize = new Size(230, 230);
  body.addSpacer();

  // present the widget
  await widget.presentLarge();

  // close the app after viewing the widget
  App.close()

}



function getSubstituteDollImage() {
  /* returns an image of the substitute doll */

  var base64String = "";

  // decode the Base64 string to image data
  var imageData = Data.fromBase64String(base64String);
  var image = Image.fromData(imageData);
  return image;
}



function getMissingnoImage() {
  /* returns an image of Missingno */

  var base64String = "";

  // decode the Base64 string to image data
  var imageData = Data.fromBase64String(base64String);
  var image = Image.fromData(imageData);
  return image;
}



function displayOfflineWidget() {
  /* displays a fallback widget on the homescreen if the users is offline */

  // start creating the actual widget
  var widget = new ListWidget();
  var startColor = new Color("#ffffff")
  var endColor = new Color("#ffa8ec")
  var gradient = new LinearGradient()
  gradient.colors = [startColor, endColor]
  gradient.locations = [0, 1]
  widget.backgroundGradient = gradient

  // create a container to hold everything
  var container = widget.addStack();
  container.layoutVertically();
  container.centerAlignContent();

  // nameStackContainer to holde the nameStack which holds the Pokémon name
  var nameStackContainer = container.addStack();
  nameStackContainer.layoutVertically();
  nameStackContainer.size = new Size(0, 80);
  nameStackContainer.centerAlignContent();

  // nameStack that hold the Pokémon name
  var nameStack = nameStackContainer.addStack();
  nameStack.layoutHorizontally();
  nameStack.addSpacer(); // left spacer for centering the name horizontally

  // add text to the nameStack
  var name = nameStack.addText("Uh oh... Looks like you're offline...");
  nameStack.addSpacer(); // right spacer for centering the name horizontally
  name.textColor = Color.black();
  name.centerAlignText(); // center text horizontally within its stack

  // determine image size based on widget size
  var widgetSize = config.widgetFamily;
  if (widgetSize === "large") {
    imgHeight = 230;
    imgWidth = 230;
    name.font = Font.boldSystemFont(30);

  } else if (widgetSize === "small") {
    imgHeight = 80;
    imgWidth = 80;
    name.font = Font.boldSystemFont(15);
    container.size = new Size(200, 0);

  } else if (widgetSize === "medium") {
    imgHeight = 100;
    imgWidth = 100;
    name.font = Font.boldSystemFont(20);
    container.layoutHorizontally();

  }

  // nameStackContainer to holde the nameStack which holds the Pokémon name
  var imageContainer = container.addStack();
  imageContainer.layoutHorizontally();
  // add a spacer to the left to center the image
  if (widgetSize != "medium") {
    imageContainer.addSpacer();
  }

  // create the silhouette image of the Pokémon
  var image = imageContainer.addImage(getSubstituteDollImage());
  image.centerAlignImage();
  image.imageSize = new Size(imgHeight, imgWidth);
  image.applyFillingContentMode();
  // add a spacer to the right to center the image
  if (widgetSize != "medium") {
    imageContainer.addSpacer();
  }

  // create the url that will execute when tapping on the widget
  var scriptName = Script.name();
  widget.url = "scriptable:///run?scriptName=" + encodeURI(scriptName) + "&offline=true";

  // set the widget
  Script.setWidget(widget);
  Script.complete();

}



function createGlitchyGradient() {
  /* creates a glitchy gradient background for when Missingno appears */

  var startColor = new Color("#f53131"); // bright red
  var midColor1 = new Color("#1a1aff"); // bright blue
  var midColor2 = new Color("#fffd82"); // bright yellow
  var midColor3 = new Color("#00ff00"); // bright green
  var midColor4 = new Color("#ff00ff"); // bright magenta
  var endColor = new Color("#000000"); // black

  // define the gradient
  var gradient = new LinearGradient();
  gradient.colors = [
    startColor,
    midColor1,
    midColor2,
    midColor3,
    midColor4,
    startColor,
    endColor
  ];
  gradient.locations = [
    0, // start red
    0.15, // sudden jump to blue
    0.3, // transition to yellow
    0.45, // sharp green
    0.6, // shift to magenta
    0.75, // return to red
    1 // end with black
  ];

  return gradient;
}



async function main() {
  /* the main functino that runs when the script runs */

  // check to see how the widget is running
  if (config.runsInWidget) {
    // if the script is running in the widget, show a silhouette of the Pokémon
    var createdWidget = await createWidget();
    // if creating the widget failed, show the offline widget
    if (!createdWidget) {
      displayOfflineWidget();
    }

  } else if (args.queryParameters.offline === "true") {
    // if the offline widget was tapped, show the Missingno widget
    revealAnswerWidget(true);

  } else if (args.queryParameters.name === undefined || args.queryParameters.artUrl === undefined) {
    // if the widget is running directly in the app, show that it should be run from a widget
    QuickLook.present("Please Run This Script From A Widget");

  } else {
    // if the user has tapped on the widget, reveal who the Pokémon was
    revealAnswerWidget();

  }

}



// run the main function
main();